                backgroundColor: URL('https://www.google.com/search?q=image&rlz=1C1CHBD_enIN948IN948&sxsrf=ALeKk02jln9qUA39WQV1DQAA7jkuJR7CVg:1629440711816&tbm=isch&source=iu&ictx=1&fir=gxFxsvFBmxeZ9M%252C0JWe7yDOKrVFAM%252C_&vet=1&usg=AI4_-kReDzFRmzDAOj_DsRSOvMu2NwesqQ&sa=X&ved=2ahUKEwiroL3W-77yAhVggUsFHVBuBywQ9QF6BAgPEAE&biw=1366&bih=625#imgrc=gxFxsvFBmxeZ9M')
            }}

           
            
        </div>
    )
}

export default BrowseHomepage
